import React from 'react';


const Todos = ({todos}) => {
    return(
        <div className="collection">
            {
                todos.length ? (
                    todos.map(todo=>{
                        return( <div className="collection-item">
                        <p>{todo.content}</p>
                     </div>)

                    })
                ) : (
                    <p>Nothing to do , Have a good day!</p>
                )
            }
        </div>
    );
}

export default Todos;
